import React from "react";
import { Link } from 'react-router-dom';

const Navbar = () => {
    return(
        <div className='navbar'>
            <p>Khoob</p>
            <div className='nav-links'>
                <Link to='/'>Home</Link>
                <Link to='/Collection'>Collection</Link>
                <Link to='/Contact'>Contact</Link>
            </div>
        </div>
    )
}

export default Navbar;
